import { ActionTypes } from "./actionType";

export const setProducts = async(products) => {
  const { data } = await axios.post("http://localhost:3001/register",
  {products},
);
  return {
    type: ActionTypes.SET_PRODUCTS,
    payload: products,
  };
};
